/** @format */

import React, { Fragment, useEffect } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Container from "react-bootstrap/Container";
import FormControl from "react-bootstrap/FormControl";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import Home from "../../Pages/Home";
import Researches from "../../Pages/Researches";
import Research from "../../Pages/Research";
import Articles from "../../Pages/Article";
import Article from "../../Pages/Articles";
import Videos from "../../Pages/Videos";
import Books from "../../Pages/Books";
import Links from "../../Pages/Links";
import Questions from "../../Pages/Questions";
import Dashboard from "../../DashboardComponents/Dashboard";
import Login from "../../DashboardComponents/auth/login";
import Register from "../../DashboardComponents/auth/register";
import "../../components/rtl.css";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { logout } from "../../actions/auth";

const NavbarF = ({ auth: { isAuthenticated, loading }, logout }) => {
  const authLinks = (
    <ul>
      <li>
        <a onClick={logout} href="#">
          <i className="fas fa-sign-out-alt" />
          <span className="hide-sm">Logout</span>
        </a>
      </li>
    </ul>
  );
  const guestLinks = (
    <Fragment>
      <Link className="nav-link NavIteamsStyle" to="/">
        الصفحة الرئيسية
      </Link>
      <Link className="nav-link NavIteamsStyle" to="/Articles">
        مقالات
      </Link>
      <Link
        className="nav-link NavIteamsStyle"
        //   onClick={this.toggleMenu}
        to="/Researches"
      >
        أبحاث
      </Link>

      <Link className="nav-link NavIteamsStyle" to="/Videos">
        فيديوهات
      </Link>
      <Link className="nav-link NavIteamsStyle" to="/Books">
        كتب
      </Link>

      <Link className="nav-link NavIteamsStyle" to="/links">
        روابط
      </Link>
      <Link className="nav-link NavIteamsStyle" to="/Questions">
        أسئلة
      </Link>
      <Route exact path="/Researches" component={Researches} />
    </Fragment>
  );

  {
    /*  <Form inline className="mr-auto navform">
        <FormControl
          type="text"
          placeholder="بحث"
          className="mr-sm-2 NavIteamsStyle"
        />
        <Button variant="outline-success" className="NavIteamsStyle Navbutton ">
          ابحث
        </Button>
  </Form>*/
  }

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container">
        <Link className="navbar-brand NavIteamsStyle" to="/">
          علم النفس الإسلامي
        </Link>
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#mobile-nav"
        >
          <span className="navbar-toggler-icon" />
        </button>

        <div className="collapse navbar-collapse" id="mobile-nav">
          <ul className="navbar-nav mr-auto">
            <li className="nav-item"></li>
          </ul>
          {isAuthenticated ? authLinks : guestLinks}
        </div>
      </div>
    </nav>
  );
};

NavbarF.protoTypes = {
  logout: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
});
export default connect(mapStateToProps, { logout })(NavbarF);
